import React from 'react';
import { Routes,Route, Navigate } from 'react-router-dom';

const AdminRoute = ({ component: Component, isAdmin, ...rest }) => (
    <Routes>
  <Route
    {...rest}
    render={(props) =>
      isAdmin ? console.log("yes") : <Navigate to="/" />
    }
  />
  </Routes>
);

export default AdminRoute;
